import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
/*Crime Rate by Area will eventually become a dynamic variable.
Every month, create a new date and set it to the last day of last month.
From last month, extract the year and month as a string (numeric and convert to text, or otherwise)
Update the label dynamically on the site.
*/
export default function VizNavigation() {

  return (
    <div id="navigation-viz">
    <Navbar expand="lg" className="navbar-form navbar-fixed-top">
      <Container>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="">Home</Nav.Link>
            <Nav.Link href="about-this-data">About the Data</Nav.Link>
            {<NavDropdown title="Crime Rate Over Time" id="basic-nav-dropdown">
              <NavDropdown.Item href="example-layout">Over Time (since 2001)</NavDropdown.Item>
              <NavDropdown.Item href="example-layout">
                Crime Rate and Unemployment in Chicago
              </NavDropdown.Item>
            </NavDropdown>}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
            {/*
              <NavDropdown title="Crime Rate by Area">
            <NavDropdown.Item href="example-layout">Crime Data by Zip Code in Chicago Last Year</NavDropdown.Item>
            <NavDropdown.Item href="example-layout">Neighborhoods by Year and Crime Rate</NavDropdown.Item>
          </NavDropdown>}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
       */}
            </div>
  );
}
